import './Login.css'
function Login(){
   return(
      <div>
          <div className="login">
              <img id='logoelement1' src="/careersynclogo.svg" alt="CareerSync Logo" />
          </div>

          <div className="logo">
              <img src='/Login-student.gif' id="logoo"></img>
          </div>
      </div>
   );
}

export default Login;
